import React from 'react';
import "../Asserts/Css/Pages/Internmalaysia.css";
import Header from '../Components/header';
import Footer from '../Components/footer';
import Navbar from '../Components/navbar';
import StudyAbroad from '../Components/StudyAbroad';
import YourNextStep from '../Components/YourNextStep';


const InternMalaysia = ()=>{
    return (
          <div className='Internmalaysiapage'>
              <Header></Header>
              <Navbar></Navbar>
             <div className='Internmalaysiastd'> <StudyAbroad></StudyAbroad></div>
             <h1 className='Internmalaysiamainhead'> Internship Assistance Malaysia </h1>
             <p>Study at Malaysia certificate in Hospitality Management (18 months).
</p>
             <h2 className='Internmalaysiaheading'>Business Management (12 months)


</h2>
<ul>
    <li><p className='Internmalaysiapara'>
    Study only for 1 month 17/11 months paid internship
</p>
</li>
    <li><p className='Internmalaysiapara'>17/11 months paid internship

</p></li>
    
</ul>
<h2>After 1 year student has below benefits
</h2>

<ul>
    <li><p></p></li>
    <li></li>
    
    </ul>


<div className='yournextstepInternmalaysia'><YourNextStep></YourNextStep></div>
           <Footer></Footer>
              </div>
    )
}

export default InternMalaysia  ;
